package com.cyber.authing.entity.domain;import com.cyber.domain.entity.OperateEntity;import lombok.*;@EqualsAndHashCode(callSuper = true)@Data@Builder@AllArgsConstructor@NoArgsConstructorpublic class Account extends OperateEntity {    /**     * 用户ID     */    private String userId;    /**     * 登录账号     */    private String account;    /**     * 密码，系统登录必选，第三方登录可空     */    private String password;    /**     * 账号类型 0 系统账号 1 微信     */    private Integer type;}